    // Input should be a vector of n 2D points or a Nx2 matrix
    cv::Mat FindEssentialMat(InputArray _points1, InputArray _points2, float focalX, float focalY, const Point2f& pp, float minimizationEpsilon)
    {
        Mat points1, points2;
        _points1.getMat().convertTo(points1, CV_64F);
        _points2.getMat().convertTo(points2, CV_64F);

        int npoints = points1.checkVector(2);
        CV_Assert(npoints >= 5 && points2.checkVector(2) == npoints &&
            points1.type() == points2.type());

        if (points1.channels() > 1)
        {
            points1 = points1.reshape(1, npoints);
            points2 = points2.reshape(1, npoints);
        }

        double ifocalX = focalX != 0 ? 1. / focalX : 1.;
        double ifocalY = focalY != 0 ? 1. / focalY : 1.;
        for (int i = 0; i < npoints; i++)
        {
            points1.at<double>(i, 0) = (points1.at<double>(i, 0) - pp.x)*ifocalX;
            points1.at<double>(i, 1) = (points1.at<double>(i, 1) - pp.y)*ifocalY;
            points2.at<double>(i, 0) = (points2.at<double>(i, 0) - pp.x)*ifocalX;
            points2.at<double>(i, 1) = (points2.at<double>(i, 1) - pp.y)*ifocalY;
        }

        // Reshape data to fit opencv ransac function
        points1 = points1.reshape(2, npoints);
        points2 = points2.reshape(2, npoints);

        Mat E;
        runKernel(points1, points2, minimizationEpsilon, E);

        return E;
    }
